import React from "react";

const Profile = () => {
    return (
        <>
            <h1 className="font-bold text-xl my-5">Profile</h1>
            <div className="rounded-lg shadow-lg border-2 border-tertiary p-10"></div>
        </>
    );
};

export default Profile;
